import React from 'react';
import { 
    BrowserRouter as Router,
    Switch, 
    Route, 
    Link
} from "react-router-dom";
import Header from './components/Header';
import Recommender from './components/Recommender';


function App() {
    return (
        <React.Fragment>
            <Router>
                <Header/>
                <DropInMenu/>
                <Recommender/>
            </Router>
        </React.Fragment>
    )
};

function DropInMenu() {
    return (
            <div id="menu">
                <p className="menuItem">Recommender</p>
                <p className="menuItem">Statistics</p>     
                <p className="menuItem">Players</p>    
                <p className="menuItem">Contact</p>            
            </div>

    )
};

export default App;
